function show_result(data) {
    let result = document.getElementById('result')
    console.log(data.originalEvent.detail[0])
    result.innerHTML = data.originalEvent.detail[0].map(elem=>{elem.value()}).join('<\br>')
}

jQuery(function($) {
    $("#arm_form").bind("ajax:success", function( xhr,data, status) { show_result(xhr)})
    console.log("Ok")
});
